import React, { useState } from 'react';
import { toJS } from 'mobx';
import { observer } from 'mobx-react';
import cx from 'classnames';
import { InfoCircleOutlined } from '@ant-design/icons';
import { Up, Pencil } from '../../../common/icons';
import AttributeValueItem from './AttributeValueItem';
import store from '../../store/RootStore';
import i18n from '../../locales';
import { parseFields } from '../../utils';
import { PolygonData } from '../../../common/shapes/Polygon';
import { LineData } from '../../../common/shapes/Line';
import './PointAttributes.scss';

const PointAttributes = observer(() => {
  const [collapsed, setCollapsed] = useState(false);
  const [infoVisible, setInfoVisible] = useState(false);

  const { selectedShapes, selectedPointIndex, config } = store.shape;
  if (selectedShapes.length !== 1 || selectedPointIndex < 0) {
    // no selected point
    return null;
  }

  const selectedShape = selectedShapes[0];
  const { instanceItem } = store.shape.shapes[selectedShape.uid];
  const frameData = instanceItem.cameras[store.frame.currentCamera].frames[store.frame.currentFrame];
  if (!frameData) {
    return null;
  }

  const { pointLabelConfig } = instanceItem.categoryItemRef;
  const { pointHotkeyMap, pointAttributes } = store.config;
  if (!pointLabelConfig && Object.keys(pointHotkeyMap).length <= 0) {
    // no config
    return null;
  }

  const useHotkey = !pointLabelConfig && Object.keys(pointHotkeyMap).length > 0;
  const pointUserData = toJS(frameData.shape as PolygonData | LineData).points[selectedPointIndex]?.userData || {};

  const renderAttrs = () => {
    const fieldsMap = parseFields(pointLabelConfig);
    const attrKeys = Object.keys(pointUserData);
    const fieldKeys = Object.keys(fieldsMap);
    const legacyKeys = attrKeys.filter((key) => !fieldKeys.includes(key));
    return [...fieldKeys, ...legacyKeys].map((key) => attrKeys.includes(key) && (
      <AttributeValueItem key={key} fieldName={key} fieldsMap={fieldsMap} values={pointUserData} />
    ));
  };

  return (
    <div
      className={cx('collapse-panel point-attributes-panel', {
        collapsed,
      })}
    >
      <div
        className="collapse-panel-title space-between"
        onClick={() => setCollapsed(!collapsed)}
      >
        <span>
          <div className="collapse-panel-collapse-icon">
            <Up />
          </div>
          {useHotkey ? (
            <>
              {i18n.translate('POINT_ATTRIBUTES_EASY')}
              <InfoCircleOutlined
                style={{ marginLeft: 4 }}
                onMouseEnter={() => setInfoVisible(true)}
                onMouseLeave={() => setInfoVisible(false)}
              />
              {infoVisible && (
                <div className="info">
                  <div>{i18n.translate('POINT_ATTRIBUTES_INFO_1')}</div>
                  <div>{i18n.translate('POINT_ATTRIBUTES_INFO_2')}</div>
                  <div>{i18n.translate('POINT_ATTRIBUTES_INFO_3')}</div>
                </div>
              )}
            </>
          ) : i18n.translate('POINT_ATTRIBUTES')}
        </span>
        {!useHotkey && (
          <span>
            {!store.readonly && (
              <div
                className="collapse-panel-icon"
                onClick={(e) => {
                  e.stopPropagation();
                  store.config.setPointAttributesModalVisible(true);
                }}
              >
                <Pencil />
              </div>
            )}
          </span>
        )}
      </div>
      <div className="collapse-panel-content">
        <div className="point-title">{i18n.translate('POINT_INDEX_LABEL', { values: { index: selectedPointIndex + config.vertexStart } })}</div>
        {useHotkey ? Object.keys(pointAttributes).map((attrKey) => (
          <div key={attrKey} className="point-attributes-item">
            <div className="point-attributes-item__label">{`${attrKey}: `}</div>
            <div className="point-attributes-item__options">
              {Array.from(pointAttributes[attrKey]).map((attr) => (
                <div
                  key={attr}
                  className={cx('', { active: pointUserData[attrKey] === attr })}
                  onClick={() => {
                    const userData = { ...pointUserData };
                    if (pointUserData[attrKey] === attr) {
                      // remove
                      delete userData[attrKey];
                    } else {
                      userData[attrKey] = attr;
                    }
                    store.shape.setPointUserData(selectedShape, selectedPointIndex, userData);
                  }}
                >
                  {attr}
                </div>
              ))}
            </div>
          </div>
        )) : renderAttrs()}
      </div>
    </div>
  );
});

export default PointAttributes;
